import React, { useState, useEffect } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
const Navbar = () => {
  const [loading, setLoading] = useState(false);
  const [userData, setUserData] = useState();
  const navigate = useNavigate();
  const logOut = () => {
    axios
      .post(
        `http://localhost:3000/api/logout`,
        {},
        {
          withCredentials: true,
        }
      )
      .then(function (response) {
        // handle success
        setLoading(false);
        //   setMessage(response?.data?.message);
        //   openSnackbar(response?.data?.message);
        localStorage.removeItem("user");
        navigate("/home");
      })
      .catch(function (error) {
        // handle error
        setLoading(false);
        //   setMessage(error?.response?.data?.message);
        //   openSnackbar(error?.response?.data?.message);
        //console.log(error?.response?.data?.message);
      })
      .then(function () {
        // always executed
      });
  };
  useEffect(() => {
    const User = localStorage.getItem("user");
    const parseUser = JSON.parse(User);
    setUserData(User);
  }, [userData]);
  return (
    <nav className="bg-gradient-to-r from-purple-600 to-purple-400 p-4">
      <div className="container mx-auto flex justify-between items-center">
        <div className="flex items-center">
          <svg
            className="fill-current h-8 w-8 mr-2 text-white"
            width="54"
            height="54"
            viewBox="0 0 54 54"
            xmlns="http://www.w3.org/2000/svg"
          >
            <path d="M13.5 22.1c1.8-7.2 6.3-10.8 13.5-10.8 10.8 0 12.15 8.1 17.55 9.45 3.6.9 6.75-.45 9.45-4.05-1.8 7.2-6.3 10.8-13.5 10.8-10.8 0-12.15-8.1-17.55-9.45-3.6-.9-6.75.45-9.45 4.05zM0 38.3c1.8-7.2 6.3-10.8 13.5-10.8 10.8 0 12.15 8.1 17.55 9.45 3.6.9 6.75-.45 9.45-4.05-1.8 7.2-6.3 10.8-13.5 10.8-10.8 0-12.15-8.1-17.55-9.45-3.6-.9-6.75.45-9.45 4.05z" />
          </svg>
          <span className="font-semibold text-xl tracking-tight text-white">
            Golang Blog
          </span>
        </div>

        <div className="flex items-center">
          <a
            href="/"
            className="text-base text-white hover:text-gray-200 mr-4"
          >
            Home
          </a>
          <a
            href="/create"
            className="text-base text-white hover:text-gray-200 mr-4"
          >
            Create Post
          </a>
          {!userData && (
            <a
              href="/register"
              className="text-base text-white hover:text-gray-200 mr-4"
            >
              Register
            </a>
          )}
          <a
            href="/personal"
            className="text-base text-white hover:text-gray-200 mr-4"
          >
            My Post
          </a>
          <div
            onClick={logOut}
            className="text-base text-white hover:text-gray-200 cursor-pointer"
          >
            {userData ? "Log Out" : "Login"}
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
